import React from 'react';
import animals from '../photos/animals.jpg';
import { Container, Row, Col } from 'react-bootstrap';

const styles = {
  backgroundImage: `url(${animals})`,
  height: '100vh',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
};

function Homepage() {
  return (
    <div style={styles}>
      <Container>
        <Row className='align-items-center'>
          <Col xs={0} md={0}>
            <h1 className='display-1 text-center'>AniHelp</h1>
          </Col>
          <Col xs={5} md={0}>
            <button className='btn btn-primary w-50'>Login</button>
          </Col>
          <Col xs={0} md={0}>
            <button className='btn btn-primary w-50'>Sign up</button>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Homepage;
